import React from "react";
import { Grid, Image, Segment } from "semantic-ui-react";

export default function FavoriteArtistCard({ artist }) {
  return (
    <Grid.Column>
      {artist.name}
      <Image src="/placeholder.png" wrapped />
    </Grid.Column>
  );
}
